window.bookSummaryJSON = "<p><b>The wealthy are crumbling.</b></p> <p>One by one, their names stain the Seattle Daily Newspaper. The ink smudges their reputation, spotlighting their depravity to the world. Monsters dressed in designer clothes. No amount of money can hide their rotting flesh paired with a corrupt soul.</p> <p>The wealthy are dying.</p> <p>But power doesn't wait, and in a city hungry for it, one second of mourning is a new blade to the throat.</p> <p>I live among them. The \"orphan girl\" blessed to taste their life. To play their games. To have their men...</p> <p>Until Julian Harrow, the son of the leading family of the Inferno Consortium and the brother of my ex-boyfriend, decides to rekindle his interest in me.</p> <p>I've known him my whole life, and that's how I know having his blue eyes follow my every move is a bad sign.</p> <p>He's ignored me for years. Now, I'm all he sees.</p> <p>But when another empire falls to its demise, will he see me?</p> <p>Or the killer in disguise?</p>"; 
